import React, { useState } from "react";

const Login = () => {
  const [username, password] = useState("");
  return (
    <div>
      <div></div>
      <div>
        <h2>Login</h2>
      </div>
      <div>
        <h5>Please enter your details to continue</h5>
      </div>
      <div>
        <input type="text" />
      </div>
      <div>
        <input type="password" placeholder="Enter your password" />
      </div>
    </div>
  );
};

export default Login;
